import React from 'react';

const Sdata = [
    {
        id: 1,
        sname:'DARK',
        imgsrc:'one.png',
        title:'Netflix original series',
        links:'https://www.google.com',
    },
    {
        id : 2,
        sname:'Blue',
        imgsrc:'Two.png',
        title:'Netflix original series',
        links:'https://www.google.com',

    },
    {
        id: 3,
        sname:'Holo Love',
        imgsrc:'one.png',
        title:'Netflix original series',
        links:'https://www.google.com',
    },
]
export default Sdata;
